import React, { useState } from "react";
import GetAllDevicesIP from "./GetAllDevicesIP";
import GetAllSubnets from "./GetAllSubnets";
import "../../styles/MainTools.css";

export default function MainTools(ac) {
  return (
    <div id="page-inner-main-templates">
      <div className="row">
        <div className="col-xs-12">
          <div className="panel panel-default">
            <div className="panel-body">
              <div className="panel panel-success">
                <div className="panel-heading">Description</div>
                <div className="panel-body">
                  <p>
                    This scripts iterates through all networks in an
                    organization and returns all the IPs associated with every
                    organization.
                  </p>
                </div>
              </div>
              {/* <a
                href="#null"
                className="btn btn-primary"
                // onClick={handleSubnets}
              >
                RUN
              </a> */}
            </div>
          </div>
        </div>
      </div>
      <div className="row">
        <div className="col-xs-12">
          <div className="panel panel-default">
            <div className="panel-body">
              {ac.ts.switchAllTools[1] ? (
                <GetAllDevicesIP dc={ac.dc} />
              ) : (
                <div></div>
              )}
              {ac.ts.switchAllTools[2] ? (
                <GetAllSubnets dc={ac.dc} />
              ) : (
                <div></div>
              )}
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}
